import React from 'react'
import { Container, Input2} from './Styled'

export default function Nome() {
  return (
    <Container>
        <label> 

          <span class="nome">Nome: </span>
          <br/>
          <Input2 type='text' name='nome' />

        </label>
    </Container>
  )
}
